        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ab, commodi. Iusto esse animi totam fugiat, reprehenderit ipsa. Necessitatibus consequatur incidunt hic laboriosam omnis totam sunt!</p>
      </div>
    </>
  )
}

export default Corevalue
